import React from 'react'

// import estilo
import './App.css'

// IMPORT COMPONENTS
import Menu from '../components/layout/Menu'
import Content from '../components/layout/Content'


const App = props => (
    <div className="App">
        <Menu />
        <Content />
    </div>
)

export default App
